void bubbleSort(int buffArray[], int length) {
	
    int buff, i;
    
    printf("entrou bubble sort\n");

   if (length == 1){
   	printf("length == 1\n");
      return;
   }
   for (i = 0; i < length - 1; i++){
   	printf("for de sorting\n");
      if (buffArray[i] > buffArray[i + 1]){
         buff = buffArray[i];
         buffArray[i] = buffArray[i + 1];
         buffArray[i + 1] = buff;
      }
   }
   length = length - 1;
   printf("chamada recursiva\n");
   bubbleSort(buffArray, length);

}

